It seems
`const_cast<const decltype(readSensors)>(readSensors)`
fails with error
> invalid use of ‘const_cast’ with type ‘const std::map<std::__cxx11::basic_string<char>, std::function<double(const std::__cxx11::basic_string<char>&)> >’, which is not a pointer, reference, nor a pointer-to-data-member type
.

Actually, all of the following four const_casts fail to compile with the same error:
```
        const int a = 3;
        int b = 3;
        printf(typeid(const_cast<const int>(a)).name());
        printf(typeid(const_cast<int>(a)).name());
        printf(typeid(const_cast<const int>(b)).name());
        printf(typeid(const_cast<int>(b)).name());
```

Getting a `decltype(readSensors)::const_iterator` with `find()` works. Trying to get a `decltype(readSensor)::iterator` fails to compile with an error mentioning readSensors can't be converted to its non-const type.

With `auto it=readSensors.find(...)`, `typeof(it)` is a const_iterator.

I guess I'll just use an auto type here, if there is no objection.
